char* QEucCodec::fromUnicode(const QString& uc, int& len_in_out) const
{
    int l = QMIN((int)uc.length(),len_in_out);
    uchar* result = new char[l*2+1];
    uchar* cursor = result;
//debug("len %d",l);
    for (int i=0; i<l; i++) {
	QChar ch = uc[i];
	if ( !ch.row && ch.cell < 128 ) {
	    *cursor++ = ch.cell;
//debug("U%02x%02x -> Euc00%02x", ch.row,ch.cell,(uchar)cursor[-1]);
	} else if ( ch.row == 0xff && ch.cell >= 0x61 && ch.cell <= 0x9F ) {
	    *cursor++ = 142;
	    *cursor++ = ch.cell+0x40;
	} else {
	    int u = unicode_to_euc[(ch.row<<8)|ch.cell];
	    if ( !u )
		u = 0xa2a2; // white box
	    *cursor++ = u >> 8;
	    *cursor++ = u & 0xff;
//debug("U%02x%02x -> Euc%02x%02x", ch.row,ch.cell,(uchar)cursor[-2],(uchar)cursor[-1]);
	}
    }
    len_in_out = cursor - result;
//debug(" -> len %d",len_in_out);
    return result;
}

QString QEucCodec::toUnicode(const char* chars, int len) const
{
    QString result;
    for (int i=0; i<len; i++) {
	uchar ch = chars[i];
	if ( ch < 128 ) {
	    // ASCII
	    result += QChar(ch);
	} else if ( ch < 142 || ch > 254 ) {
	    // Invalid
	    result += QChar::replacement;
	} else if ( ch == 142 ) {
	    // Half-width katakana
	    if ( i < len-1 ) {
		uchar c2 = chars[++i];
		if ( c2 >= 0xa1 && c2 <= 0xdf ) {
		    result += QChar(c2-0x40,0xff);
		} else {
		    result += QChar::replacement;
		}
	    }
	} else if ( ch == 143 ) {
	    // User-defined characters
	    if ( i < len-1 ) {
		uchar c2 = chars[++i];
		if ( c2 < 161 || c2 > 254 ) {
		    i--;
		    result += QChar::replacement;
		} else {
		    if ( i < len-1 ) {
			uchar c3 = chars[++i];
			if ( c3 < 161 || c3 > 254 ) {
			    result += QChar::replacement;
			    i--;
			} else
			    result += QChar::replacement;
		    }
		}
	    }
	} else {
	    // JIS X 0208-1990
	    if ( i < len-1 ) {
		uchar c2 = chars[++i];
		if ( c2 < 161 || c2 > 254 ) {
		    result += QChar::replacement;
		    i--;
		} else {
		    int c = (ch << 8) | c2;
		    ushort rc = euc_to_unicode[c];
		    result += QChar(rc&0xff,(rc>>8)&0xff);
		}
	    } else {
		result += QChar::replacement;
	    }
	}
    }
    return result;
}

