int QEucCodec::heuristicNameMatch(const char* hint) const
{
    if ( strnicmp(hint,"ja_JP",5)==0 )
	return 1;
    else
	return QTextCodec::heuristicNameMatch(hint);
}

int QEucCodec::heuristicContentMatch(const char* chars, int len) const
{
    int score = 0;
    for (int i=0; i<len; i++) {
	uchar ch = chars[i];
	// No nulls allowed.
	if ( !ch )
	    return -1;
	if ( ch < 32 && ch != '\t' && ch != '\n' && ch != '\r' ) {
	    // Suspicious
	    if ( score )
		score--;
	} else if ( ch < 128 ) {
	    // Inconclusive
	} else if ( ch < 142 || ch > 254 ) {
	    // Invalid
	    return -1;
	} else if ( ch == 142 ) {
	    // Half-width katakana
	    if ( i < len-1 ) {
		uchar c2 = chars[++i];
		if ( c2 < 161 || c2 >223 )
		    return -1;
		score++;
	    }
	    score++;
	} else if ( ch == 143 ) {
	    // User-defined characters
	    if ( i < len-1 ) {
		uchar c2 = chars[++i];
		if ( c2 < 161 || c2 > 254 )
		    return -1;
		if ( i < len-1 ) {
		    uchar c3 = chars[++i];
		    if ( c3 < 161 || c3 > 254 )
			return -1;
		    score++;
		}
		score++;
	    }
	    score++;
	} else {
	    // JIS X 0208-1990
	    if ( i < len-1 ) {
		uchar c2 = chars[++i];
		if ( c2 < 161 || c2 > 254 )
		    return -1;
		score++;
	    }
	    score++;
	}
    }
    return score;
}




class QEucDecoder : public QTextDecoder {
    uchar buf[3];
    int nbuf;
public:
    QEucDecoder() : nbuf(0)
    {
    }

    QString toUnicode(const char* chars, int len)
    {
	QString result;
	for (int i=0; i<len; i++) {
	    uchar ch = chars[i];
	    switch (nbuf) {
	      case 0:
		if ( ch < 128 ) {
		    // ASCII
		    result += QChar(ch);
		} else if ( ch < 142 || ch > 254 ) {
		    // Invalid
		    result += QChar::replacement;
		} else {
		    buf[0] = ch;
		    nbuf = 1;
		}
		break;
	      case 1:
		if ( buf[0] == 142 ) {
		    // Half-width katakana
		    if ( ch >= 0xa1 && ch <= 0xdf ) {
			result += QChar(ch-0x40,0xff);
		    } else {
			result += QChar::replacement;
		    }
		    nbuf = 0;
		} else if ( buf[0] == 143 ) {
		    // User-defined characters
		    buf[1] = ch;
		    nbuf = 2;
		} else {
		    // JIS X 0208-1990
		    if ( ch < 161 || ch > 254 ) {
			// Error
			result += QChar::replacement;
		    } else {
			int c = (buf[0] << 8) | ch;
			ushort rc = euc_to_unicode[c];
			result += QChar(rc&0xff,(rc>>8)&0xff);
		    }
		    nbuf = 0;
		}
		break;
	    case 2:
		// User-defined characters
		if ( ch < 161 || ch > 254 ) {
		    result += QChar::replacement;
		} else {
		    // We don't decoder user-defined characters
		    // ### Could use the user-defined space in Unicode
		    result += QChar::replacement;
		}
		nbuf = 0;
	    }
	}
	return result;
    }
};

QTextDecoder* QEucCodec::makeDecoder() const
{
    return new QEucDecoder;
}

